CREATE DEFINER=`root`@`localhost` FUNCTION `fn_cotizacion_dameSigNumCotizacion`() RETURNS int(11)
BEGIN
SET @sigCot = 0;
SELECT (CAST(numero_cotizacion AS UNSIGNED) + 1) INTO @sigCot 
FROM cotizaciones 
ORDER BY numero_cotizacion DESC 
LIMIT 1;

RETURN @sigCot;
SET @sigCot = 0;
END ;;
