CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_catalogo_dameCatalogo`(IN idCategoria BIGINT)
BEGIN 
	SELECT 
		p.id_producto as id, p.nombre_producto as nombre, p.descripcion_producto as descripcion,
		pc.nombre_productocategoria as categoria, ppv.precio_venta as precioVenta,m.nombre_marca as marca,imagen_producto as imagen
	FROM
		producto p
	INNER JOIN producto_categoria pc on pc.id_productocategoria = p.id_productocategoria
		AND p.id_productocategoria = idCategoria
        AND p.estatus_producto = 'ACTIVO'
        AND pc.estatus_productocategoria = 'ACTIVO'
	INNER JOIN producto_precio_venta ppv on ppv.id_producto = p.id_producto
		AND ppv.estatus_precio_venta = 'ACTIVO'
	INNER JOIN marcas m on m.id_marca = p.id_marca
	ORDER BY p.nombre_producto ASC;
END ;;
DELIMITER ;
