CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_catalogo_dameInfoProducto`(IN idProducto BIGINT)
BEGIN 
	SELECT 
    p.nombre_producto AS nombre,
    p.descripcion_producto AS descripcion,
		p.desc_default as isDefaultDesc,
    p.id_marca AS idMarca,
    p.imagen_producto AS imagen,
    ppv.precio_venta AS precioVenta,
    GROUP_CONCAT(CONCAT_WS('-',
                ppr.id_producto_tiempo,
                ppr.precio_renta)) AS preciosRenta
FROM
    producto p
        INNER JOIN
    producto_precio_venta ppv ON p.id_producto = ppv.id_producto
        AND ppv.estatus_precio_venta = 'ACTIVO'
        AND p.id_producto = idProducto
        AND p.estatus_producto = 'ACTIVO'
        LEFT OUTER JOIN
    producto_precio_renta ppr ON p.id_producto = ppr.id_producto
        AND ppr.estatus_precio_renta = 'ACTIVO'
GROUP BY p.id_producto;
    
END ;;
