CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_catalogo_eliminaEquipo`(IN idProducto bigint(20),IN idUsuario bigint(20))
BEGIN

	UPDATE producto 
	SET estatus_producto = 'INACTIVO',
		  fecha_movimiento = now(),
			origen_movimiento = 'SISTEMA',
			usuario_movimiento = idUsuario
	WHERE id_producto = idProducto;
	
	UPDATE producto_precio_venta 
	SET estatus_precio_venta = 'INACTIVO',
		  fecha_movimiento = now(),
			origen_movimiento = 'SISTEMA',
			usuario_movimiento = idUsuario
	WHERE id_producto = idProducto;

	UPDATE producto_precio_renta 
	SET estatus_precio_renta = 'INACTIVO',
		  fecha_movimiento = now(),
			origen_movimiento = 'SISTEMA',
			usuario_movimiento = idUsuario
	WHERE id_producto = idProducto;
	
	
END ;;
