CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_catalogo_guardaEquipo`(IN nombreProducto varchar(100), IN descripcion varchar(500),IN isDefaultDesc bit,IN idCategoria bigint(20),IN idMarca bigint(20), IN precioVenta decimal(10,2), IN imagenProducto MEDIUMBLOB, IN isImgVacio bit,IN id bigint(20), IN idUsuario bigint(20))
BEGIN

DECLARE idProducto bigint(20);

IF(id = '' || id IS NULL)
THEN
	INSERT INTO producto(nombre_producto,descripcion_producto,desc_default,id_productocategoria,id_marca,imagen_producto,estatus_producto,fecha_registro,origen_registro,usuario_registro,fecha_movimiento,origen_movimiento,usuario_movimiento)
	VALUES (nombreProducto,descripcion,isDefaultDesc,idCategoria,idMarca,imagenProducto,'ACTIVO',now(),'SISTEMA',idUsuario,now(),'SISTEMA',idUsuario);
	
	SELECT LAST_INSERT_ID() into idProducto;
	
	INSERT INTO producto_precio_venta(id_producto,precio_venta,estatus_precio_venta,fecha_registro,origen_registro,usuario_registro,fecha_movimiento,origen_movimiento,usuario_movimiento) VALUES (idProducto,precioVenta,'ACTIVO',now(),'SISTEMA',idUsuario,now(),'SISTEMA',idUsuario);
	
	SELECT idProducto as idProducto;
	
ELSE

	SET @consulta = '';
	
	SET  @consulta = concat(@consulta,'UPDATE producto 
																		 SET nombre_producto = ',QUOTE(nombreProducto),',
																				 descripcion_producto = ',QUOTE(descripcion),',
																				 desc_default = ',QUOTE(isDefaultDesc),',
																				 id_productocategoria = ',idCategoria,',
																				 id_marca = ',idMarca,',');
	IF(imagenProducto <> '' && imagenProducto IS NOT NULL && imagenProducto <> 'NULL')
	THEN
		SET  @consulta = concat(@consulta,'imagen_producto = ',QUOTE(imagenProducto),',');
	ELSEiF(isImgVacio = 1)
	THEN
		SET  @consulta = concat(@consulta,'imagen_producto = NULL,');
	END IF;
	
	SET  @consulta = concat(@consulta,'fecha_movimiento = now(),
																		 origen_movimiento = ''SISTEMA'',
																		 usuario_movimiento = ',idUsuario,'
																		 WHERE id_producto = ',id);
  
	PREPARE stmt FROM @consulta;
	EXECUTE stmt;
	deallocate PREPARE stmt;
  
	SET @consulta = '';
	
	UPDATE producto_precio_venta 
	SET estatus_precio_venta = 'INACTIVO', 
			fecha_movimiento = now(),
			origen_movimiento = 'SISTEMA',
			usuario_movimiento = idUsuario
	WHERE id_producto = id;
	
	INSERT INTO producto_precio_venta(id_producto,precio_venta,estatus_precio_venta,						  fecha_registro,origen_registro,usuario_registro,fecha_movimiento,					   	 origen_movimiento,usuario_movimiento) VALUES (id,precioVenta,'ACTIVO',							 now(),'SISTEMA',idUsuario,now(),'SISTEMA',idUsuario);
						
	SELECT id as idProducto;		

END IF;
	
END ;;
DELIMITER ;
