CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_finanzas_dameCotizaciones`()
BEGIN 
	SELECT 
    id_cotizacion AS id,
    numero_cotizacion AS folio,
    ruta_cotizacion AS ruta,
    cliente_cotizacion AS cliente,
    tipo_cotizacion AS tipo,
    total_cotizacion AS total,
    date(fecha_registro) as fecha
	FROM
			cotizaciones c
	WHERE
			c.estatus_cotizacion = 'ACTIVO'
					AND date(c.fecha_registro) >= DATE_SUB(CURDATE(),INTERVAL 1 YEAR) 
	ORDER BY c.fecha_registro DESC;
END ;;
