CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_finanzas_guardaCliente`(IN nombre varchar(100), IN razonSocial varchar(100), IN rfc varchar(45), IN persona varchar(15), IN direccion varchar(100), IN colonia varchar(100), IN dirFiscal varchar(100), IN correo varchar(45), IN id BIGINT(20), IN idUsuario bigint(20))
BEGIN

SET @idCliente = '';

IF(id = '' || id IS NULL)
THEN
	INSERT INTO clientes
	(
		nombre_cliente,
		razonsocial_cliente,
		rfc_cliente,
		persona_cliente,
		direccion_cliente,
		colonia_cliente,
		direccionfiscal_cliente,
		correo_cliente,
		estatus_cliente,
		fecha_registro,
		origen_registro,
		usuario_registro,
		fecha_movimiento,
		origen_movimiento,
		usuario_movimiento
	) VALUES
	(
		nombre,
		razonSocial,
		rfc,
		persona,
		direccion,
		colonia ,
		dirFiscal ,
		correo ,
		'ACTIVO',
		now(),
		'SISTEMA',
		idUsuario,
		now(),
		'SISTEMA',
		idUsuario
	);
	
	SELECT LAST_INSERT_ID() into @idCliente;
	
ELSE
	UPDATE clientes
	SET nombre_cliente = nombre,
			razonsocial_cliente = razonSocial,
			rfc_cliente = rfc,
			persona_cliente = persona,
			direccion_cliente = direccion,
			colonia_cliente = colonia,
			direccionfiscal_cliente = dirFiscal,
			correo_cliente = correo,
			fecha_movimiento = now(),
			origen_movimiento = 'SISTEMA',
			usuario_movimiento = idUsuario
	WHERE id_cliente = id;
	
	SELECT id into @idCliente;

END IF;

SELECT @idCliente as idCliente;

SET @idCliente = '';

END ;;
DELIMITER ;
