CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_finanzas_guardaCotizacion`(IN ruta varchar(100), IN cliente varchar(100), IN tipo varchar(10), IN total decimal(10,2), IN idUsuario BIGINT(20))
BEGIN

	SET @sigCot = 0;

	SELECT fn_cotizacion_dameSigNumCotizacion() into @sigCot;


	INSERT INTO cotizaciones
	(
		numero_cotizacion,
		ruta_cotizacion,
		cliente_cotizacion,
		tipo_cotizacion,
		total_cotizacion,
		estatus_cotizacion,
		fecha_registro,
		origen_registro,
		usuario_registro,
		fecha_movimiento,
		origen_movimiento,
		usuario_movimiento
	) VALUES
	(
		@sigCot,
		ruta,
		cliente,
		tipo,
		total,
		'ACTIVO',
		now(),
		'SISTEMA',
		idUsuario,
		now(),
		'SISTEMA',
		idUsuario
	);
	
	
	SET @sigCot = 0;
END ;;
