CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_login_validaLogin`(IN correoUsr varchar(45), IN passUsr varchar(200))
BEGIN
	SELECT correo_usuario as correo, id_perfil as idPerfil, id_usuario as idUsuario, nombre_usuario as nombre
	FROM _usuario
	WHERE correo_usuario = correoUsr
		AND pass_usuario= passUsr
		AND estatus_usuario = 'ACTIVO';
END ;;
