CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_sistema_dameInfoModulo`(IN idModulo BIGINT)
BEGIN 
	SELECT 
    nombre_modulo AS nombre, ruta_modulo AS ruta
	FROM
		_modulo
	WHERE
		id_modulo = idModulo
			AND estatus_modulo = 'ACTIVO';
    
END ;;
