CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_sistema_dameModulosMenu`(IN idPadre BIGINT, IN idPerfil BIGINT)
BEGIN 
	SELECT m.id_modulo as id, nombre_modulo as modulo, id_modulopadre as idPadre, p.id_modulo as permiso,m.icono_modulo as icono
	FROM _modulo m
	INNER JOIN _permiso p ON p.id_modulo = m.id_modulo
		AND p.id_perfil = idPerfil 
		AND p.estatus_permiso = 'ACTIVO'
		AND m.estatus_modulo = 'ACTIVO'
	WHERE id_modulopadre = idPadre
	ORDER BY orden_modulo ASC;
    
END ;;
